import React from 'react';
import './assets/navbar.css';
import { Link, NavLink } from 'react-router-dom';

const Menu = () => {
  return (
    <nav>
      <NavLink to="/home" className="menu-item" activeClassName="active">
        <img src="https://cdn-icons-png.flaticon.com/512/8280/8280362.png" alt="Icon 1" />
        <div className="item-content">
          <p className="item-title">Item 1</p>
          <div className="line"></div>
        </div>
      </NavLink>

      <NavLink to="/ConfigurarEvento" className="menu-item" activeClassName="active">
        <img src="https://cdn-icons-png.flaticon.com/512/10746/10746540.png" alt="Icon 2" />
        <div className="item-content">
          <p className="item-title">Item 2</p>
          <div className="line"></div>
        </div>
      </NavLink>

      <NavLink to="/CrearTipoEvento" className="menu-item" activeClassName="active">
        <img src="https://cdn-icons-png.flaticon.com/512/9790/9790435.png" alt="Icon 3" />
        <div className="item-content">
          <p className="item-title">Item 3</p>
          <div className="line"></div>
        </div>
      </NavLink>
    </nav>
  );
};

export default Menu;
